// import * as fs from "fs";

function convertToImage(){
    let inputarray = document.getElementById('input-matrix').value;
    let height = Number(document.getElementById('height').value);
    let width = Number(document.getElementById('width').value);

    let imagearray = JSON.parse(inputarray);

     // add placeholder pixel for the alpha value
     for (let i = 2; i < imagearray.length; i += 4) {
        imagearray.splice(i + 1, 0, 255);
    }

    // create off-screen canvas element
    var canvas = document.createElement('canvas'),
        ctx = canvas.getContext('2d');
    
    canvas.width = width;
    canvas.height = height;

    var imgData = ctx.getImageData(0,0,width,height);
    var data = imgData.data;

    for(var i = 0; i < data.length; i += 4) {
        data[i] = imagearray[i];
        data[i+1] = imagearray[i+1];
        data[i+2] = imagearray[i+2];
        data[i+3] = 255;
    }

    // put the modified pixels back on the canvas
    ctx.putImageData(imgData,0,0);

    // create a new img object
    var image=new Image();

    // set the img.src to the canvas data url
    image.src=canvas.toDataURL();

    // append the new img object to the page
    document.body.appendChild(image);
}

